import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

// Defining the main App component
function App() {
    // State to store the data fetched from the backend
    const [data, setData] = useState(null);

    // State to track whether the data is still loading
    const [loading, setLoading] = useState(true);

    // State to store any error that occurs during the data fetch
    const [error, setError] = useState(null);

    // useEffect hook to fetch data from the backend when the component mounts
    useEffect(() => {
        // Making a GET request to the backend API
        axios.get('http://127.0.0.1:8000/api/test/')
            .then(response => {
                // Setting the fetched data to the state
                setData(response.data);

                // Indicating that loading is complete
                setLoading(false);
            })
            .catch(error => {
                // Setting the error to the state if the request fails
                setError(error);

                // Indicating that loading is complete even if there is an error
                setLoading(false);
            });
    }, []); // Empty dependency array ensures this runs only once when the component mounts

    // If the data is still loading, display a loading message
    if (loading) return <div>Loading...</div>;

    // If there is an error, display the error message
    if (error) return <div>Error: {error.message}</div>;

    // Returning the main JSX structure of the app
    return (
        // Wrapping the app in a Router to enable routing
        <Router>
            <div>
                {/* Header section with navigation links */}
                <header>
                    <nav>
                        {/* Link to the home route */}
                        <Link to="/">Home</Link>
                    </nav>
                </header>

                {/* Defining the routes for the app */}
                <Routes>
                    {/* Route for the home page */}
                    <Route path="/" element={
                        <div>
                            {/* Displaying a welcome message */}
                            <h1>Welcome to the React Frontend</h1>

                            {/* Displaying the message from the backend response */}
                            <p>Backend Response: {data?.message}</p>
                        </div>
                    } />
                </Routes>
            </div>
        </Router>
    );
}

// Exporting the App component as the default export
export default App;

const fetchUserLocation = () => {
    if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(
            (position) => {
                const { latitude, longitude } = position.coords;
                console.log("User coordinates:", latitude, longitude);
                sendCoordinatesToBackend(latitude, longitude);
            },
            (error) => {
                console.error("Error fetching location:", error);
            }
        );
    } else {
        console.error("Geolocation is not supported by this browser.");
    }
};

useEffect(() => {
    fetchUserLocation();
}, []);

const sendCoordinatesToBackend = async (latitude, longitude) => {
    try {
        const response = await axios.post('http://127.0.0.1:8000/api/suggestions/', {
            latitude,
            longitude,
        });
        console.log("Backend response:", response.data);
    } catch (error) {
        console.error("Error sending coordinates:", error);
    }
};


const WeatherApp = () => {
  const [coordinates, setCoordinates] = useState({
    latitude: 37.7749,
    longitude: -122.4194
  });
  const [weatherData, setWeatherData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      const response = await axios.post(
        'http://localhost:8000/api/suggestions/',
        coordinates,
        {
          headers: {
            'Content-Type': 'application/json',
          }
        }
      );
      setWeatherData(response.data);
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to fetch weather data');
      console.error('API Error:', err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ maxWidth: '600px', margin: '0 auto', padding: '20px' }}>
      <h1>Weather App</h1>

      <form onSubmit={handleSubmit}>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="latitude" style={{ display: 'block', marginBottom: '5px' }}>
            Latitude:
          </label>
          <input
            id="latitude"
            type="number"
            value={coordinates.latitude}
            onChange={(e) => setCoordinates({
              ...coordinates,
              latitude: parseFloat(e.target.value)
            })}
            step="0.0001"
            style={{ width: '100%', padding: '8px' }}
          />
        </div>

        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="longitude" style={{ display: 'block', marginBottom: '5px' }}>
            Longitude:
          </label>
          <input
            id="longitude"
            type="number"
            value={coordinates.longitude}
            onChange={(e) => setCoordinates({
              ...coordinates,
              longitude: parseFloat(e.target.value)
            })}
            step="0.0001"
            style={{ width: '100%', padding: '8px' }}
          />
        </div>

        <button 
          type="submit" 
          disabled={loading}
          style={{
            padding: '10px 15px',
            background: '#007bff',
            color: 'white',
            border: 'none',
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          {loading ? 'Loading...' : 'Get Weather'}
        </button>
      </form>

      {error && (
        <div style={{ color: 'red', marginTop: '15px' }}>
          Error: {error}
        </div>
      )}

      {weatherData && (
        <div style={{ marginTop: '20px', padding: '15px', border: '1px solid #ddd', borderRadius: '4px' }}>
          <h2>Weather Information</h2>
          <pre>{JSON.stringify(weatherData, null, 2)}</pre>
        </div>
      )}
    </div>
  );
};
